import React from 'react';
import "../../../scss/Home.scss";
import BasicLayout from '../../../layout/BasicLayout';
const Home = (props) => {
    const {setCheckLogin} = props;
    return (
        <BasicLayout setCheckLogin={setCheckLogin} className="home">
            <div className="home-title">
                <h2>Inicio</h2>
            </div>
            <p>Lista de Yweets</p>
            <p>Cargar tweets</p>
        </BasicLayout>
    );
}
export default Home;
